  \"2015-12-20T18:34:44.002274\",\n\t\"name\": \"1992-mount-spurr-usa-images\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Following 39 years of inactivity, Crater
  Peak vent on the south flank of Mount Spurr volcano burst into eruption at 7:04
  a.m. Alaska daylight time (ADT) on June 27, 1992. The Municipality of Anchorage
  reported nearly $2 million in damage, office closures, and cleanup costs from the
  August eruption. In addition, there were numerous, small-scale losses incurred by
  businesses. No loss of life resulted directly from the eruptions. However, two heart
  attacks, one fatal, from shoveling ashfall were reported in Anchorage.\",\n\t\"license_title\":
